// src/components/NavbarComponent.js
import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';

const NavbarComponent = ({ onNavClick }) => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" fixed="top">
      <Container>
        <Navbar.Brand href="#hero" onClick={e => { e.preventDefault(); onNavClick('hero'); }}>
          Swarnim's Portfolio
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link href="#hero" onClick={e => { e.preventDefault(); onNavClick('hero'); }}>Home</Nav.Link>
            <Nav.Link href="#career-objective" onClick={e => { e.preventDefault(); onNavClick('career-objective'); }}>Career Objective</Nav.Link>
            <Nav.Link href="#technical-skills" onClick={e => { e.preventDefault(); onNavClick('technical-skills'); }}>Technical Skills</Nav.Link>
            <Nav.Link href="#education" onClick={e => { e.preventDefault(); onNavClick('education'); }}>Education</Nav.Link>
            <Nav.Link href="#professional-development" onClick={e => { e.preventDefault(); onNavClick('professional-development'); }}>Professional Development</Nav.Link>
            <Nav.Link href="#work-experience" onClick={e => { e.preventDefault(); onNavClick('work-experience'); }}>Work Experience</Nav.Link>
            <Nav.Link href="#references" onClick={e => { e.preventDefault(); onNavClick('references'); }}>References</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
